.model COMPACT ; main menu using mouse 
clearWholeScreen MACRO
	                 mov ah, 0
	                 mov al, 3
	                 INT 10H  	;FOR VIDEO DISPLAY
	ENDM
MOVEMENT MACRO UP, DOWN, LEFT, RIGHT, FIRING
	
	         mov cx, 0

	         cmp ah,UP
	         jz  MoveUp

	         cmp ah,DOWN
	         jz  MoveDown

	         cmp ah,LEFT
	         jz  MoveLeft

	         cmp ah,RIGHT
	         jz  MoveRight

	         cmp ah, FIRING
	         jz  Fire
ENDM
delay macro duration
	      local lp
	      push  cx
	      mov   cx, duration
	lp:   loop  lp
	      pop   cx

endm
exitProg macro
	         mov ah,4ch
	         int 21h
ENDM
