name ENDS
.code
MAIN PROC FAR
	                          mov      ax,  @data
	                          mov      ds, ax
	mainMenuLoop:             
	                          mov      ax, graphicsMode         	; enter graphicsMode
	                          mov      bx, 0100h                	; BX = 81FFh
	                          int      10h
	
	                          call     drawLogo
	                          call     drawGameBtn
	                          call     drawChatBtn
	                          call     drawExitBtn
	                          call     drawArrows

	CheckInMainMenu:          
	                          mov      ah,0                     	;  ah:al = scan code: ASCII code
	                          int      16h

	                          cmp      ah, 48h                  	; up arrow
	                          jne      downArrow
	                          cmp      arrowoffsetY, arrowAtgame
	                          je       CheckInMainMenu
	                          call     eraseArrows
	                          mov      bx, arrowStep
	                          SUB      arrowoffsetY, bx
	                          call     drawArrows
	                          jmp      CheckInMainMenu

	downArrow:                cmp      ah, 50h                  	; down arrow
	                          jne      enterbtn
	                          cmp      arrowoffsetY, arrowAtExit
	                          je       CheckInMainMenu
	                          call     eraseArrows

	                          mov      bx, arrowStep
	                          ADD      arrowoffsetY, bx
	                          call     drawArrows

	                          jmp      CheckInMainMenu

	enterbtn:                 cmp      ah, 01ch                 	; enter
	                          jne      CheckInMainMenu          	; added to prevent other buttons from doing enter's action
	                          cmp      arrowoffsetY, arrowAtExit

	                          jne      mainMenu_continue
	                          exitProg
	mainMenu_continue:        
	                          cmp      arrowoffsetY, arrowAtChat
	
	                          cmp      arrowoffsetY, arrowAtgame
	                          je       gameLoop
	                          jmp      CheckInMainMenu
	gameLoop:                                                   	;NOTE:since we are using words, we will use the value '2' to traverse pixels
	;//////////////////////////////initializations////////////////////////////////////
	                          mov      ax, graphicsMode
	                          mov      bx, 0100h
	                          int      10h
	                          call     drawShip1
	                          call     drawShip2
	;////////////////////////////Interacting with the user////////////////////////////
	CHECK:                    
	                          mov      BX, 0
	                          LEA      SI, BulletDirection
	                          LEA      DI, BulletOffset
	CHECKBULLETS:             mov      ah,0
	                          mov      Al, [SI]
	                          CMP      Al, 0
	                          JE       ContinueBullet
	                          CALL     EraseBullet
	                          MOV      dx, MAXBULLETRIGHT
	                          CMP      [DI], dx
	                          JLE      StopBullet
	                          CMP      [DI], MAXBULLETLEFT
	                          JGE      StopBullet
	                          CALL     Bullet_Offset
	                          CALL     DrawBullet
	                          jmp      ContinueBullet
	StopBullet:               mov      dl, 0
	                          mov      [SI], dl
	ContinueBullet:           INC      BX
	                          ADD      SI, 1
	                          ADD      DI, 4
	                          CMP      BX, MAXBULLET
	                          JE       ContinueBullets
	                          JMP      CHECKBULLETS

	ContinueBullets:          
	                          delay    65000
	
	                          mov      ah,1
	                          int      16h
	                          jz       CHECK                    	; check if there is any input
	                          cmp      ah, 11H
	                          jz       moveShip1
	                          cmp      ah, 1FH
	                          jz       moveShip1
	                          cmp      ah, 1EH
	                          jz       moveShip1
	                          cmp      ah, 20H
	                          jz       moveShip1
	                          cmp      ah, 21H
	                          jz       moveShip1
                        

	                          cmp      ah, 48H
	                          jz       moveShip2
	                          cmp      ah, 50H
	                          jz       moveShip2
	                          cmp      ah, 4BH
	                          jz       moveShip2
	                          cmp      ah, 4DH
	                          jz       moveShip2
	                          cmp      ah, 1CH
	                          jz       moveShip2
                        
	moveShip1:                
	                          call     GENERATE_OFFSET1
	                          jmp      gameLoop
	moveShip2:                
	                          CALL     GENERATE_OFFSET2         	; TO GENERATE THE new OFFSET OF THE ship
	                          jmp      gameLoop
	;/////////////////////////////////////////////////////////////////////////////////

	exitProg_label:           
	                          mov      ah,4ch
	                          int      21h
        

MAIN ENDP

GENERATE_OFFSET1 PROC near

	                          cmp      al,1Bh                   	; ESC
	                          jnz      GENERATE_OFFSET1_continue
	                          exitProg
	GENERATE_OFFSET1_continue:cmp      ah, 21H
	                          jz       DontErase
	                          call     Eraseship1               	; get the pressed key from the user
	DontErase:                MOVEMENT 11H, 1FH, 1EH, 20H, 21H


	ReadKey:                  
	                          call     Drawship1

	                          mov      ah,0                     	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                          int      16h

	                          mov      cx, 0                    	; initialize cx to use it to iterate over the shipSize
	                          jmp      CHECK


	ReadFire:                 
	;call             DrawBullet

	                          mov      ah,0                     	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                          int      16h

	                          mov      cx, 0                    	; initialize cx to use it to iterate over the Bullet Size
	                          jmp      CHECK
	;///////////////////////////////////////////////////////////////////////////////////////
	MoveUp:                   
	;checking for boundaries
	;moveUP
	                          mov      bx, shipOffsetY1
	                          cmp      bx, screenMinY1
	                          jna      ReadKey
	                          sub      bx, planeSpeed
	                          mov      DI, offset shipOffsetY1
	                          mov      [DI], bx

	                          jmp      ReadKey

	MoveDown:                 
	;checking for boundaries
	;MoveDown
	                          mov      bx, shipOffsetY1
	                          mov      cx, bx
	                          add      cx, shipSizeY1
	                          cmp      cx, screenMaxY1
	                          jnb      ReadKey
	                          add      bx,planeSpeed
	                          mov      DI, offset shipOffsetY1
	                          mov      [DI], bx

	                          jmp      ReadKey

	MoveLeft:                 
	;checking for boundaries
	                          mov      bx, shipOffsetX1
	                          cmp      bx, screenMinX1
	                          jna      ReadKey
	                          sub      bx, planeSpeed
	                          mov      DI, offset shipOffsetX1
	                          mov      [DI], bx
	          
	                          jmp      ReadKey

	MoveRight:                
	;checking for boundaries
	                          mov      bx, shipOffsetX1
	                          mov      cx, bx
	                          add      cx, shipSizeX1
	                          cmp      cx, screenMaxX1
	                          jnb      ReadKey
	                          add      bx, planeSpeed
	                          mov      DI, offset shipOffsetX1
	                          mov      [DI], bx

	                          jmp      ReadKey


	Fire:                     
	                          mov      bx, 0
	                          LEA      SI, BulletDirection
	findEmptyBullet:          MOV      DL, 0
	                          CMP      [SI], DL
	                          JE       found
	                          CMP      BX, MAXBULLET
	                          JE       notFound
	                          INC      BX
	                          INC      SI
	                          JMP      findEmptyBullet
    
	notFound:                 ret

	found:                    mov      dl, 1
	                          mov      [SI], dl                 	; For Right Direction
	                          LEA      DI, BulletOffset
	                          ADD      DI, BX
	                          ADD      DI, BX
	                          ADD      DI, BX
	                          ADD      DI, BX

	; For x
                    
	                          mov      dX, shipOffsetX1
	                          add      DX, shipSizeX1
	                          INC      DX
	                          MOV      [DI], DX
                
	; For y

	                          mov      dx, shipSizeY1
	                          sub      dx, BulletYSize

	; ; These steps for division
	; ; First push ax to stack as we need it after that
	                          push     ax

	; ; Divsion Process
	                          mov      ax, dx
	                          mov      cl, 2
	                          div      cl
	                          mov      dx, ax

	; ; retrive the value of reg ax
	                          pop      ax
	                          add      dx, shipOffsetY1

	                          mov      [DI] + 2, dx
	                          jmp      ReadFire

	                      
	                          ret

GENERATE_OFFSET1 ENDP
GENERATE_OFFSET2 PROC near

	                          mov      cx, 0
	                          cmp      ah, 1CH
	                          jz       DontErase2
	                          call     Eraseship2               	; get the pressed key from the user
	DontErase2:               

	                          cmp      ah,48H
	                          jz       MoveUp2

	                          cmp      ah,50H
	                          jz       MoveDown2

	                          cmp      ah,4BH
	                          jz       MoveLeft2

	                          cmp      ah,4DH
	                          jz       MoveRight2
	                          cmp      ah,1CH
	                          jz       FIRE2



	ReadKey2:                 
	                          call     Drawship2

	                          mov      ah,0                     	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                          int      16h

	                          mov      cx, 0                    	; initialize cx to use it to iterate over the shipSize
	                          jmp      CHECK
	;///////////////////////////////////////////////////////////////////////////////////////
	MoveUp2:                  
	;checking for boundaries
	;moveUP
	                          mov      bx, shipOffsetY2
	                          cmp      bx, screenMinY2
	                          jna      ReadKey2
	                          sub      bx, planeSpeed
	                          mov      DI, offset shipOffsetY2
	                          mov      [DI], bx

	                          jmp      ReadKey2

	MoveDown2:                
	;checking for boundaries
	;MoveDown
	                          mov      bx, shipOffsetY2
	                          mov      cx, bx
	                          add      cx, shipSizeY2
	                          cmp      cx, screenMaxY2
	                          jnb      ReadKey2
	                          add      bx,planeSpeed
	                          mov      DI, offset shipOffsetY2
	                          mov      [DI], bx

	                          jmp      ReadKey2

	MoveLeft2:                
	;checking for boundaries
	                          mov      bx, shipOffsetX2
	                          cmp      bx, screenMinX2
	                          jna      ReadKey2
	                          sub      bx, planeSpeed
	                          mov      DI, offset shipOffsetX2
	                          mov      [DI], bx
	          
	                          jmp      ReadKey2

	MoveRight2:               
	;checking for boundaries
	                          mov      bx, shipOffsetX2
	                          mov      cx, bx
	                          add      cx, shipSizeX2
	                          cmp      cx, screenMaxX2
	                          jnb      ReadKey2
	                          add      bx, planeSpeed
	                          mov      DI, offset shipOffsetX2
	                          mov      [DI], bx

	                          jmp      ReadKey2
	                          ret
	Fire2:                    
	                          mov      bx, 0
	                          LEA      SI, BulletDirection
	findEmptyBullet2:         MOV      DL, 0
	                          CMP      [SI], DL
	                          JE       found2
	                          CMP      BX, MAXBULLET
	                          JE       notFound2
	                          INC      BX
	                          INC      SI
	                          JMP      findEmptyBullet2
    
	notFound2:                ret

	found2:                   mov      dl, 2
	                          mov      [SI], dl                 	; For Right Direction
	                          LEA      DI, BulletOffset
	                          ADD      DI, BX
	                          ADD      DI, BX
	                          ADD      DI, BX
	                          ADD      DI, BX

	; For x
                    
	                          mov      dX, shipOffsetX2
	                          sub      dx, BulletXSize
	                          INC      DX
	                          MOV      [DI], DX
                
	; For y

	                          mov      dx, shipSizeY2
	                          sub      dx, BulletYSize

	; ; These steps for division
	; ; First push ax to stack as we need it after that
	                          push     ax

	; ; Divsion Process
	                          mov      ax, dx
	                          mov      cl, 2
	                          div      cl
	                          mov      dx, ax

	; ; retrive the value of reg ax
	                          pop      ax
	                          add      dx, shipOffsetY2

	                          mov      [DI] + 2, dx
	                          jmp      ReadFire

	                      
GENERATE_OFFSET2 ENDP


